import './App.css';

function App() {
  return (
    <div className="App">
      <h1>An electricity bill system


have a bunch of users
Each user
	- id
	- name
	- Address
	- Bill/usage
	- Payed last month (bool) (check if payed last month)



be able to give random amounts for the bills and then if the user didnt pay last month adda 15% fee onto this months bill</h1>
    </div>
  );
}

export default App;
